webpackJsonp([0xcd998ea4dcf6],{4764:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Sweet dreams are made of this",date:"14 Mar 2001",slug:"/2001-03-14-sweet-dreams-are-made-of-this/",tags:"Y2001"},html:"<p>I thought we would have something to say today, but it turns out we're all three too tired. Good night!</p>"},next:{fields:{title:"kill 1",date:"12 Mar 2001",slug:"/2001-03-12-kill-1/"}},previous:{fields:{title:"Dot Bomb",date:"15 Mar 2001",slug:"/2001-03-15-dot-bomb/"}}},{node:{fields:{title:"kill 1",date:"12 Mar 2001",slug:"/2001-03-12-kill-1/",tags:"Y2001"},html:'<p><b>20:00h</b></p>\n<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2001/03/clap.jpg" height="225" width="300" border="0" alt="clap.jpg: " /></p>\n<p><b>Early</b><br />\nWhen logged in remotely as root to your server, typing \'kill 1 120\' when you mean \'kill -1 120\' can really ruin your morning. (Rather than restarting process 120 with signal 1, I ended up killing process 1, the init process, effectively halting the computer.)</p>'},next:{fields:{title:"",date:"11 Mar 2001",slug:"/2001-03-11-zu-spaet-too-late/"}},previous:{fields:{title:"Sweet dreams are made of this",date:"14 Mar 2001",slug:"/2001-03-14-sweet-dreams-are-made-of-this/"}}},{node:{fields:{title:"",date:"11 Mar 2001",slug:"/2001-03-11-zu-spaet-too-late/",tags:"Y2001"},html:'<p><b>Late</b><br />\nOh no! Sheila\'s got the <a href="http://sheila.inessential.com/2001/03/10">Norwegian Computer Virus</a>!</p>\n<p><b>Middle</b><br />\nDoch eines Tages werd\' ich mich rächen //<br />\nich werd die Herzen aller Mädchen brechen //<br />\ndann bin ich ein Star, der in der Zeitung steht //<br />\ndann tut es dir leid, doch dann ist es <a href="http://mode.exit.mytoday.de/jb-3/loadz/lirixall/a/arzte_z.htm">zu sp</a><br />\n...Die Ärzte</p>\n<p>(Some day I\'ll have my revenge // I\'ll break the hearts of all the girls //<br />\nI\'ll be star who is in the newspaper // then you\'ll be sorry, but then it will be too late)</p>\n<p>An old adolescent punk song from a German band that still hasn\'t grown up. Christopher is already breaking hearts, but hopefully he can skip the star bit.</p>\n<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2001/03/ball.jpg" height="332" width="249" border="0" alt="ball.jpg: " /></p>'},next:{fields:{title:"Kissed the Air, Said Goodbye...",date:"07 Mar 2001",slug:"/2001-03-07-kissed-the-air-said-goodbye/"}},previous:{fields:{title:"kill 1",date:"12 Mar 2001",slug:"/2001-03-12-kill-1/"}}}],pathPrefix:"",first:!1,last:!1,index:1015,pageCount:1101}}}});
